customer_review:
i tossed this to my pup while i broke down the shipping boxes for recycling. i probably left her with it for 3 minutes and came back to find a chunk of the toy missing. it may not look like much, but the piece she threw up half a day later was pretty sizable. i kind of regret not taking a pic of that as well.  

i know im always making a gamble when i buy toys marketed for "tough chewers", so i like to give some grace, but this one has to be a record for my girl. i barely had a chance to step in and stop her.  

if you're doubtful of your pup having this toy, maybe skip this purchase. invest in a handful of kongs and fill them up with tasty frozen treats instead :)
